import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M6.95 7.95a3.23 3.23 0 014.6 0l.44.47.45-.46a3.23 3.23 0 014.6.01 3.3 3.3 0 01.02 4.64l-4.69 4.73a.5.5 0 01-.7 0L6.96 12.6a3.3 3.3 0 01-.01-4.64zM22 12a10 10 0 10-20 0 10 10 0 0020 0zm-1.5 0a8.5 8.5 0 11-17 0 8.5 8.5 0 0117 0z", fill: primaryFill }));
};
const HeartCircle24Regular = wrapIcon(rawSvg({}), 'HeartCircle24Regular');
export default HeartCircle24Regular;
